import React from 'react';
import PropTypes from 'prop-types';

const Textbox = ({ initial_text }) => {
  return (
    <div>
      <form className='form'>
        <textarea
          rows='4'
          cols='50'
          name='comment'
          form='usrform'
          className='#ffebee red lighten-5'
          style={{ height: '500px' }}
        >
          {initial_text}
        </textarea>

        <input
          type='submit'
          value='Run'
          className='btn waves-effect waves-light'
        >
          Run
        </input>
      </form>
    </div>
  );
};
Textbox.propTypes = {
  initial_text: PropTypes.string.isRequired
};

export default Textbox;
